import React, {Component} from 'react'
import { Navbar } from 'react-bootstrap'
import './App.css'

class App extends Component {

    constructor (props) {
        super(props)
        this.state = {
            account: '0x0'
        }
    }

    render() {
        return (
            <div>
                <Navbar account= {this.state.account}/>
                    <div className='text-center'>
                    <h></h>
                    </div>
            </div>
        )
    }
}

export default App;
